import base64

# Invalid Base64 string (missing padding)
invalid_base64_string = ""

# Add padding
invalid_base64_string += "=" * (4 - len(invalid_base64_string) % 4)
# Decode Base64 to binary
try:
    binary_data = base64.b64decode(invalid_base64_string)
    #print(binary_data)
except base64.binascii.Error as e:
    print(f"Error decoding Base64: {e}")

print(repr(binary_data))
encodings_to_try = ['utf-8', 'latin-1', 'utf-16']

import pyperclip

for encoding in encodings_to_try:
    try:
        decoded_string = binary_data.decode(encoding)
        print(f"Decoded using {encoding}:")
        pyperclip.copy(decoded_string)
        break
    except UnicodeDecodeError:
        print(f"Failed to decode using {encoding}")






